/*Table structure for table `descriptions` */

DROP TABLE IF EXISTS `descriptions`;

CREATE TABLE `descriptions` (
  `descriptionId` bigint(20) NOT NULL AUTO_INCREMENT,
  `description` text NOT NULL,
  `dateCreated` timestamp NOT NULL DEFAULT current_timestamp(),
  `dateUpdated` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`descriptionId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `descriptions` */

/*Table structure for table `discounts` */

DROP TABLE IF EXISTS `discounts`;

CREATE TABLE `discounts` (
  `discountId` bigint(20) NOT NULL AUTO_INCREMENT,
  `discount` varchar(45) NOT NULL,
  `percentage` int(11) NOT NULL,
  `dateCreated` timestamp NOT NULL DEFAULT current_timestamp(),
  `dateUpdated` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`discountId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `discounts` */

/*Table structure for table `generics` */

DROP TABLE IF EXISTS `generics`;

CREATE TABLE `generics` (
  `genericId` bigint(20) NOT NULL AUTO_INCREMENT,
  `genericName` varchar(45) NOT NULL,
  `dateCreated` timestamp NOT NULL DEFAULT current_timestamp(),
  `dateUpdated` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`genericId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `generics` */

/*Table structure for table `packaging_units` */

DROP TABLE IF EXISTS `packaging_units`;

CREATE TABLE `packaging_units` (
  `packagingUnitId` bigint(20) NOT NULL AUTO_INCREMENT,
  `packagingUnitName` varchar(45) NOT NULL,
  `dateCreated` timestamp NOT NULL DEFAULT current_timestamp(),
  `dateUpdated` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`packagingUnitId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

/*Data for the table `packaging_units` */

/*Table structure for table `products` */

DROP TABLE IF EXISTS `products`;

CREATE TABLE `products` (
  `productId` bigint(20) NOT NULL AUTO_INCREMENT,
  `descriptionId` bigint(20) NOT NULL,
  `packagingUnitId` bigint(20) NOT NULL,
  `quantity` int(11) NOT NULL,
  `price` double NOT NULL,
  `discount` double DEFAULT NULL,
  `discounted` double DEFAULT NULL,
  `genericId` bigint(20) NOT NULL,
  `dateCreated` timestamp NOT NULL DEFAULT current_timestamp(),
  `dateUpdated` timestamp NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`productId`),
  KEY `descriptionId` (`descriptionId`),
  KEY `packagingUnitId` (`packagingUnitId`),
  KEY `genericId` (`genericId`),
  CONSTRAINT `products_ibfk_1` FOREIGN KEY (`descriptionId`) REFERENCES `descriptions` (`descriptionId`),
  CONSTRAINT `products_ibfk_2` FOREIGN KEY (`packagingUnitId`) REFERENCES `packaging_units` (`packagingUnitId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `products_ibfk_3` FOREIGN KEY (`genericId`) REFERENCES `generics` (`genericId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

