/* Procedure structure for procedure `insertDescription` */

/*!50003 DROP PROCEDURE IF EXISTS  `insertDescription` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`` PROCEDURE `insertDescription`(pDescription text)
BEGIN
		insert into descriptions(`description`)
		values(pDescription);
	END */$$
DELIMITER ;

/* Procedure structure for procedure `insertUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `insertUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`` PROCEDURE `insertUser`(pProfilePicture BLOB, pFirstName VARCHAR(45), pMiddleName VARCHAR(45), pLastName VARCHAR(45),
    pAddress VARCHAR(45), pContactNumber VARCHAR(45), pEmail VARCHAR(45), pUsername VARCHAR(45), pPassword VARBINARY(255))
BEGIN
		INSERT INTO users(profilePicture, firstName, middleName, lastName, address, contactNumber, email, username, `password`)
		VALUES(pProfilePicture, pFirstName, pMiddleName, pLastName, pAddress, pContactNumber, pEmail, pUsername,
		AES_ENCRYPT(pPassword, '.!!#?lLJjW31t8!.?eqsw'));
	END */$$
DELIMITER ;

